import React, { useEffect } from "react";
import { Link } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { deleteDetails, getDetail } from "../../Redux/actions";
import styles from "./Detail.css";

export default function DogDetail(props) {
    console.log(props)
  const dispatch = useDispatch();
  const detail = useSelector((state) => state.detail);

  useEffect(() => {
    dispatch(getDetail(props.match.params.id));
    return () => dispatch(deleteDetails());
  }, [dispatch, props.match.params.id]);

  const myDog = useSelector((state) => state.detail);

  return (
    <div>
    {
        myDog.length>0 ?
        (
            detail.find((dog) => dog.created === true) ? (
              <div className={styles.dogDetail}>
                <h1>{detail[0].name}</h1>
                <img src={detail[0].image} alt="" />
                <h2>Life Span {detail[0].life_span}</h2>
                <h2>Temperaments</h2>
                <h2>{detail[0].temperament}</h2>
                <h2>weight</h2>
                <h2>Min{detail[0].weight_min}</h2>
                <h2> Max{detail[0].weight_max}</h2>
                <Link to= '/home'>
                    <button>Volver</button>
                </Link>
              </div>
            ) : (
              <div className={styles.dogDetail}>
                <h1>{detail[0].name}</h1>
                <img src={detail[0].image} alt="" />
                <h2>Origin: {detail[0].origin}</h2>
                <h2>Temperaments</h2>
                <h2>{detail[0].temperament}</h2>
                <h2>weights</h2>
                <h2>{detail[0].weight.imperial} cm</h2>
                <Link to= '/home'>
                    <button>Volver</button>
                </Link>
              </div>
            )
          ) : (
            <div>
              <h1>Loading</h1>
            </div>
          )}
          </div>

  )

}
